By inheriting from the Gain class, you can create your own Gain. In this section, we will define Focus which generates a single focus. The essence of Gain is vector<array<uint16_t, 249>> _data, which is a vector of the number of devices in the array for the number of transducers of 16bit data. In each 16bit data, the higher 8bit represents the duty ratio and the lower 8bit represents the phase. Below is a sample of the Gain that generates a single focus. #include "autd3.hpp"
#include "autd3/core/utils.hpp" class Focus final : public autd::core::Gain { public: Focus(autd::Vector3 point) : _point(point) {} static autd::GainPtr create(autd::Vector3 point) { return std::make_shared<Focus>(point); } void calc(const autd::GeometryPtr& geometry) override { const auto wavenum = 2.0 * M_PI / geometry->wavelength(); for (size_t dev = 0; dev < geometry->num_devices(); dev++) for (size_t i = 0; i < autd::NUM_TRANS_IN_UNIT; i++) { const auto dist = (geometry->position(dev, i) - this->_point).norm(); const auto phase = autd::core::Utilities::to_phase(dist * wavenum); this->_data[dev][i] = autd::core::Utilities::pack_to_u16(0xFF, phase); } } private: autd::Vector3 _point;
}; Controller::send function takes a GainPtr type (an alias of shared_ptr<autd::core::Gain>) as an argument. Therefore, you should define a create function to return it. In the example, since we want to create a single focus, we pass the focus position as an argument. If you pass GainPtr to Controller::send, the method Gain::calc will be called internally. So, you should calculate the phase/amplitude in the calc method. For the duty ratio D∈[0,255] of 8bit specified by SDK and the phase P∈[0,255] of 8bit, the ultrasonic sound pressure p radiated from the transducer will be modeled as, p(r)∝sin(2π​256D+Doffset​​)eiλ2π​∥r∥e−2πi256P​. Here, λ is the wavelength. Also, Doffset​ is Doffset​=1 by default, which can be changed optionally. Therefore, the sound pressure is maximum at D=255 [2] . In order to maximize the sound pressure of the ultrasound emitted from a large number of transducers at a certain point p, the phase at p should be aligned. Therefore, we have to set ϕ as, ϕ=−2π256P​=λ2π​∥r∥, where r is the distance between the transducer and the focal point. In SDK, you can get the wavelength by Geometry::wavelength() and the position of the transducer by Geometry::position(). The first argument of Geometry::position() is the index of the device, and the second argument is the local index of transducers. The autd::core::Utilities::to_phase function is a utility function to convert the above phase ϕ in rad to the internal representation P of SDK, defined as follows [3] . inline static uint8_t to_phase(const double phase) noexcept { return static_cast<uint8_t>(static_cast<int>(std::round((phase / (2.0 * M_PI) + 0.5) * 256.0)) & 0xFF); } Also, autd::core::Utilities::pack_to_u16 is a utility function that simply takes two uint8_t values and packs them into the high/low 8bit of the uint16_t value. You need to compile it from the source code. It is not included in the pre-built binary uploaded to GitHub. In the case of Doffset​=1, it seems that the amplitude does not become zero even if D=0, but as far as we checked with the oscilloscope, the input signal to the transducer disappears, so there is no problem in fact. The reason for +0.5 is that the return value of std::arg etc. is [−π,π]. [hasegawa2017]: Hasegawa, Keisuke, et al. "Electronically steerable ultrasound-driven long narrow air stream." Applied Physics Letters 111.6 (2017): 064104. [inoue2015]: Inoue, Seki, Yasutoshi Makino, and Hiroyuki Shinoda. "Active touch perception produced by airborne ultrasonic haptic hologram." 2015 IEEE World Haptics Conference (WHC). IEEE, 2015. [long2014]: Long, Benjamin, et al. "Rendering volumetric haptic shapes in mid-air using ultrasound." ACM Transactions on Graphics (TOG) 33.6 (2014): 1-10. [marzo2019]: Marzo, Asier, and Bruce W. Drinkwater. "Holographic acoustic tweezers." Proceedings of the National Academy of Sciences 116.1 (2019): 84-89. [plasencia2020]: Plasencia, Diego Martinez, et al. "GS-PAT: high-speed multi-point sound-fields for phased arrays of transducers." ACM Transactions on Graphics (TOG) 39.4 (2020): 138-1. [levenberg1944]: Levenberg, Kenneth. "A method for the solution of certain non-linear problems in least squares." Quarterly of applied mathematics 2.2 (1944): 164-168. [marquardt1963]: Marquardt, Donald W. "An algorithm for least-squares estimation of nonlinear parameters." Journal of the society for Industrial and Applied Mathematics 11.2 (1963): 431-441. [madsen2004]: Madsen, Kaj, Hans Bruun Nielsen, and Ole Tingleff. "Methods for non-linear least squares problems." (2004). [hasegawa2020]: Hasegawa, Keisuke, Hiroyuki Shinoda, and Takaaki Nara. "Volumetric acoustic holography and its application to self-positioning by single channel measurement." Journal of Applied Physics 127.24 (2020): 244904. [suzuki2021]: Suzuki, Shun, et al. "Radiation Pressure Field Reconstruction for Ultrasound Midair Haptics by Greedy Algorithm with Brute-Force Search." IEEE Transactions on Haptics (2021).

