Basically, it is designed to be the same as the C++ version. For example, the equivalent code of Getting Started is the following. using AUTD3Sharp;
using AUTD3Sharp.Utils; namespace example
{ internal class Program { public static string GetIfname() { var adapters = AUTD.EnumerateAdapters(); var etherCATAdapters = adapters as EtherCATAdapter[] ?? adapters.ToArray(); foreach (var (adapter, index) in etherCATAdapters.Select((adapter, index) => (adapter, index))) Console.WriteLine($"[{index}]: {adapter}"); Console.Write("Choose number: "); int i; while (!int.TryParse(Console.ReadLine(), out i)) { } return etherCATAdapters.ElementAt(i).Name; } public static void Main() { var autd = new AUTD(); autd.AddDevice(Vector3d.Zero, Vector3d.Zero); var ifname = GetIfname(); var link = Link.SOEM(ifname, autd.NumDevices); if (!autd.Open(link)) { Console.WriteLine(AUTD.LastError); return; } autd.Clear(); var firmList = autd.FirmwareInfoList().ToArray(); foreach (var (firm, index) in firmList.Select((firm, i) => (firm, i))) Console.WriteLine($"AUTD {index}: {firm}"); autd.SilentMode = false; const double x = AUTD.TransSpacing * ((AUTD.NumTransInX - 1) / 2.0); const double y = AUTD.TransSpacing * ((AUTD.NumTransInY - 1) / 2.0); const double z = 150.0; var g = Gain.FocalPoint(new Vector3d(x, y, z)); var m = Modulation.Sine(150); autd.Send(g, m); Console.ReadKey(true); autd.Close(); } }
} For a more detailed example, see autd3sharp's example .

