First, open a terminal and prepare an directory. mkdir autd3_sample cd autd3_sample Next, make CMakeLists.txt and main.cpp files. └─autd3_sample CMakeLists.txt main.cpp Next, download the latest binary version of the SDK. The binaries are available at GitHub Release . Unzip the downloaded binary, and copy the include and lib folders to the autd3_sample folder. └─autd3_sample │ CMakeLists.txt │ main.cpp ├─include └─lib Next, download Eigen3, which is a header-only library for matrix computation. Here, we change the current directory to autd3_sample and add Eigen3 as git submodule. git init git submodule add https://gitlab.com/libeigen/eigen.git eigen cd eigen git checkout 3.4.0 cd .. Alternatively, you can directly download Eigen3 and put it under the autd3_sample folder. The Eigen3 version used in the SDK is 3.4.0. At this time, the directory structure is as follows. └─autd3_sample │ CMakeLists.txt │ main.cpp ├─include ├─lib └─eigen ├─bench ├─blas ├─ci ├─cmake ... Next, write CMakeLists.txt as follows. cmake_minimum_required(VERSION 3.16) project(autd3_sample)
set (CMAKE_CXX_STANDARD 17) add_executable(main main.cpp) target_compile_definitions(main PRIVATE _USE_MATH_DEFINES)
target_link_directories(main PRIVATE lib)
target_include_directories(main PRIVATE include eigen) if(WIN32) target_link_directories(main PRIVATE lib/wpcap) target_link_libraries(main autd3 soem_link Packet.lib wpcap.lib ws2_32.lib winmm.lib)
elseif(APPLE) target_link_libraries(main pcap)
else() target_link_libraries(main rt)
endif() if(WIN32) set_property(DIRECTORY ${CMAKE_CURRENT_SOURCE_DIR} PROPERTY VS_STARTUP_PROJECT main)
endif() And, write main.cpp as follows. This source code will apply 150Hz AM modulation to a single focus at 150mm above of center of the array. #include <iostream> #include "autd3.hpp"
#include "autd3/link/soem.hpp" using namespace std;
using namespace autd; string get_adapter_name() { size_t i = 0; const auto adapters = link::SOEM::enumerate_adapters(); for (auto&& [desc, name] : adapters) cout << "[" << i++ << "]: " << desc << ", " << name << endl; cout << "Choose number: "; string in; getline(cin, in); stringstream s(in); if (const auto empty = in == "\n"; !(s >> i) || i >= adapters.size() || empty) return ""; return adapters[i].name;
} int main() try { auto autd = Controller::create(); autd->geometry()->add_device(Vector3(0, 0, 0), Vector3(0, 0, 0)); const auto ifname = get_adapter_name(); auto link = link::SOEM::create(ifname, autd->geometry()->num_devices()); autd->open(std::move(link)); autd->clear(); auto firm_info_list = autd->firmware_info_list(); for (auto&& firm_info : firm_info_list) cout << firm_info << endl; autd->silent_mode() = true; const auto focus = Vector3(TRANS_SPACING_MM * ((NUM_TRANS_X - 1) / 2.0), TRANS_SPACING_MM * ((NUM_TRANS_Y - 1) / 2.0), 150.0); const auto g = gain::FocalPoint::create(focus); const auto m = modulation::Sine::create(150); autd->send(g, m); cout << "press enter to finish..." << endl; cin.ignore(); autd->close(); return 0;
} catch (exception& ex) { cerr << ex.what() << endl;
} Then, build with CMake. mkdir build cd build cmake .. -G "Visual Studio 17 2022" -A x64 autd3_sample.sln should be generated under the build directory, so open it and run the main project. Note that you should change the build configuration of Visual Studio from Debug to Release . In case of Linux/macOS, you may need to run the program as root user.

