Basically, it is designed to be the same as the C++ version. For example, the equivalent code of Getting Started is the following. use autd3::prelude::*;
use autd3_soem_link::{EthernetAdapters, SoemLink};
use std::io::{self, Write}; fn get_adapter() -> String { let adapters: EthernetAdapters = Default::default(); for (index, adapter) in adapters.into_iter().enumerate() { println!("[{}]: {}", index, adapter); } let i: usize; let mut s = String::new(); loop { print!("Choose number: "); io::stdout().flush().unwrap(); io::stdin().read_line(&mut s).unwrap(); match s.trim().parse() { Ok(num) if num < adapters.len() => { i = num; break; } _ => continue, }; } let adapter = &adapters[i]; adapter.name.to_string()
} async fn main_task() { let mut geometry = Geometry::new(); geometry.add_device(Vector3::zeros(), Vector3::zeros()); let ifname = get_adapter(); let link = SoemLink::new(&ifname, geometry.num_devices() as u16, 1, |msg| { eprintln!("unrecoverable error occurred: {}", msg); std::process::exit(-1); }); let mut autd = Controller::open(geometry, link).expect("Failed to open"); autd.clear().await.unwrap(); println!("***** Firmware information *****"); let firm_list = autd.firmware_infos().await.unwrap(); for firm_info in firm_list { println!("{}", firm_info); } println!("********************************"); autd.silent_mode = true; let center = Vector3::new( TRANS_SPACING_MM * ((NUM_TRANS_X - 1) as f64 / 2.0), TRANS_SPACING_MM * ((NUM_TRANS_Y - 1) as f64 / 2.0), 150.0, ); let mut g = Focus::new(center); let mut m = Sine::new(150); autd.send(&mut g, &mut m).await.unwrap(); let mut _s = String::new(); io::stdin().read_line(&mut _s).unwrap(); autd.close().await.unwrap();
} fn main() { let rt = tokio::runtime::Runtime::new().unwrap(); rt.block_on(async { main_task().await });
} For a more detailed example, see rust-autd's example .
